// HomePage.js
import React from 'react';
import './HomePage.css';

function HomePage() {
  return (
    <div className="container">
      <div className="section">Players</div>
      <div className="section">Wonder Kids</div>
      <div className="section">Clubs</div>
      <div className="logo">Football Manager logosu</div>
      <div className="section">Comparison</div>
      <div className="section">Free Transfers</div>
      <div className="section">Log in</div>
    </div>
  );
}

export default HomePage;
